		public static void DrawLineQ(Vector2 lineStart, Vector2 lineEnd, Texture2D texture, int thickness, Color color)
		{
			if (color != Util.color)
			{
				Util.texture.SetPixel(0, 0, color);
				Util.texture.Apply();
				Util.color = color;
			}
			Vector2 vector = lineEnd - lineStart;
			float num = 57.29578f * Mathf.Atan(vector.y / vector.x);
			if ((double)vector.x < 0.0)
			{
				num += 180f;
			}
			if (!float.IsNaN(num) && !float.IsNaN(lineStart.x) && !float.IsNaN(lineStart.y) && !float.IsNaN(lineEnd.x) && !float.IsNaN(lineEnd.y))
			{
				if (thickness < 1)
				{
					thickness = 1;
				}
				int num2 = (int)Mathf.Ceil((float)(thickness / 2));
				GUIUtility.RotateAroundPivot(num, lineStart);
				GUI.DrawTexture(new Rect(lineStart.x, lineStart.y - (float)num2, vector.magnitude, (float)thickness), texture);
				GUIUtility.RotateAroundPivot(-num, lineStart);
				return;
			}
		}

		private void ESP(object player)
		{

			float num = 6f;
			Transform transform = (Transform)Util.getField("BaseNetPlayer", "PlayerTransform", player);
			Vector3 vector = transform.transform.position - Camera.main.transform.position;
			if (Vector3.Dot(Camera.main.transform.forward, vector) > 0f)
			{
				float health = getPlayerHealth(player);
