					return;
				}
				Vector3 playerNeckPosition = this.getNeckPosition(player);
				Vector3 playerPosition = Camera.main.WorldToScreenPoint(transform.position);
				Vector3 neckPosition = Camera.main.WorldToScreenPoint(playerNeckPosition);
				if (playerPosition.z < 1f)
				{
					return;
				}
				playerPosition.y = (float)Screen.height - playerPosition.y;
				float num2 = 120f * (num / playerPosition.z);
				float num3 = (float)(isSeat(player) ? 160 : 240) * (num / playerPosition.z);
				float num8 = Vector3.Distance(transform.position, Camera.main.transform.position);
				float thick = 1f;
				if (EspName)
				{
					GUI.Label(new Rect(playerPosition.x - num2 / 2f - 10f, playerPosition.y - num3 / 2f - 32f, 200f, 20f), string.Concat(new object[] { "[", text, "]" }));

				}
				if (EspHealch)
				{

					GUI.Label(new Rect(playerPosition.x - num2 / 2f - 10f, playerPosition.y - num3 / 2f - 20f, 200f, 20f), string.Concat(new object[] { "[HP:", health, "]", "[DIST:", ((int)num8).ToString(), "]" }));
				}
				//GUI.Label(new Rect(playerPosition.x - num2 / 2f - 10f, playerPosition.y - num3 / 2f - 20f, 200f, 20f), string.Concat(new object[]
				//{+
				//	text,
				//	" [",
				//	getPlayerHealth(player),
				//	"]"
				//}));
				Vector2.Distance(new Vector2(neckPosition.x, (float)Screen.height - neckPosition.y), new Vector2((float)(Screen.width / 2), (float)Screen.height));
				int num4 = 1 << LayerMask.NameToLayer("physics") | 1 << LayerMask.NameToLayer("indoor") | 1 << LayerMask.NameToLayer("indoor_culling") | 1 << LayerMask.NameToLayer("outdoor") | 1 << LayerMask.NameToLayer("outdoor_culling") | 1 << LayerMask.NameToLayer("terrain");
				bool flag = !Physics.Linecast(Camera.main.transform.position, playerNeckPosition, num4);
				Color color = flag ? Color.green : Color.red;
				if (EspBox)
				{
					Util.DrawESP(new Vector2(playerPosition.x - num2 / 2f, playerPosition.y - num3 / 2f), new Vector2(num2, num3), thick, color);
				}
				if (EspLine)
				{ 
				MainClass.DrawLineQ(new Vector2((float)((int)neckPosition.x), (float)((int)((float)Screen.height - neckPosition.y))), new Vector2((float)(Screen.width / 2), (float)Screen.height), Util.texture, 1, color);
				}
				if (!flag)
				{
					return;
				}
				float num5 = Vector2.Distance(new Vector2(neckPosition.x, (float)Screen.height - neckPosition.y), new Vector2((float)(Screen.width / 2), (float)(Screen.height / 2)));
				if (num5 < this.NeckDistance)
				{
					this.NeckPosition = playerNeckPosition;
					this.NeckDistance = num5;
				}
			}
