		private bool isTeamate(object player)
		{
			if (!(bool)Util.getProperty("BaseGame", "IsTeamGame", Util.getProperty("Peer", "ClientGame", GameObject.Find("net"))))
			{
				return false;
			}
			object localPlayer = Util.getProperty("BaseClientGame", "LocalPlayer", Util.getProperty("Peer", "ClientGame", GameObject.Find("net")));
			object localPlayerTeam = Util.getProperty("BaseNetPlayer", "PlayerType", localPlayer);
			object playerTeam = Util.getProperty("BaseNetPlayer", "PlayerType", player);
			return (int)localPlayerTeam == (int)playerTeam;
		}
